import { Button } from "bootstrap";

<p>verify</p>;
function CheckOtp() {
  return (
    <>
      <h2>Forgot Password</h2>
      <div class="checkEmail">
        <p>Email Address</p>
        <input
          type="email"
          name="email"
          placeholder="Enter your email.."
        ></input>
        <Button>Submit</Button>
      </div>
    </>
  );
}
export default CheckOtp;
